import './App.css';
import * as React from "react";
import { Admin, Resource, ListGuesser } from 'react-admin';
import jsonServerProvider from 'ra-data-json-server';

const dataProvider = jsonServerProvider('https://jsonplaceholder.typicode.com');
const App = () => {
    return (
        <Admin dataProvider={dataProvider}>
            <Resource
                name="tournaments"
                icon={TrainIcon}
                list={RailwayStationList}
                show={
                    permissions && permissions.canView('railwayStations')
                        ? RailwayStationShow
                        : null
                }
                create={
                    permissions && permissions.canChange('railwayStations')
                        ? RailwayStationCreate
                        : null
                }
                edit={
                    permissions && permissions.canChange('railwayStations')
                        ? RailwayStationEdit
                        : null
                }
            />
        </Admin>
    );
};

export default App;
